const gymcontainerStyle = theme => ({
    paper: {
        height: "calc(100% - 2rem)", 
        [theme.breakpoints.up("sm")]: {
            marginTop: theme.spacing(5)
        }
    },
    paperHidden: {
        width: "72vw",
        [theme.breakpoints.up("sm")]: {
            marginTop: theme.spacing(5),
            marginLeft: "auto",
            marginRight: "auto",
        }
    },
    tab:{
        flexGrow: "1"
    },
    tabpanel: {
        height: "inherit"
    },
    manageDataTable:{
        height: "70vh"
    }
});



export default gymcontainerStyle;
